import React from 'react';

const Services = () => {
  return (
    <>
      <div>
        <div>
            <h3>Graphic Design Services:</h3>
            <p>Offer services like social media management, search engine optimization (SEO), pay-per-click advertising, content marketing, and email marketing to help businesses improve their online presence and reach.</p>
        </div>
        <div></div>
        <div></div>
        <div></div>
      </div>
    </>
  );
}

export default Services;
